var peso_Inicial;
var peso_Inicial;
var peso_Atual;
var varAltura;
var peso_Ideal;
var excesso_Inicial;
var excesso_Atual;
var excesso_Eliminado;
var varPerda;

function calculo() {
    peso_Inicial      = parseFloat( $("#pesoInicial").val().replace(",","."));
    peso_Atual        = parseFloat( $("#pesoAtual").val().replace(",","."));
    varAltura         = parseFloat( $("#altura").val().replace(",","."));
    peso_Ideal        = varAltura*varAltura*25;
    excesso_Inicial   = (peso_Inicial - peso_Ideal).toFixed(2);
    excesso_Atual     = (peso_Atual - peso_Ideal).toFixed(2);
    excesso_Eliminado = peso_Inicial-peso_Atual;
    varPerda          = ((excesso_Eliminado)*100)/excesso_Inicial;
    
    $("#excessoInicial").val((excesso_Inicial>0)?excesso_Inicial.replace(".",","):"0");
    $("#imcInicial").val((peso_Inicial>0&&varAltura>0)?(peso_Inicial/(varAltura*varAltura)).toFixed(2).replace(".",","):"0");
    $("#excessoAtual").val((excesso_Atual>0)?excesso_Atual.replace(".",","):"0");
    $("#imcAtual").val((peso_Atual>0&&varAltura>0)?(peso_Atual/(varAltura*varAltura)).toFixed(2).replace(".",","):"0");
	$("#perdaKG").val(excesso_Eliminado);
	$("#perdaPERCENT").val(varPerda.toFixed(2).replace(".",","));
		
    $("#mes1").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.15)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.2)).toFixed(2).replace(".",","):"0");
    $("#mes2").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.25)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.3)).toFixed(2).replace(".",","):"0");
    $("#mes3").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.3)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.4)).toFixed(2).replace(".",","):"0");
    $("#mes6").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.45)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.55)).toFixed(2).replace(".",","):"0");
    $("#mes9").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.55)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.65)).toFixed(2).replace(".",","):"0");
    $("#mes12").val((peso_Inicial>0&&excesso_Inicial>0)?(peso_Inicial-(excesso_Inicial*0.65)).toFixed(2).replace(".",",") + ' - ' + (peso_Inicial-(excesso_Inicial*0.85)).toFixed(2).replace(".",","):"0");
    
    var now = new Date(); 
    var hours = now.getHours(); 
    var minutes = now.getMinutes(); 
    var timeValue = "" + hours + ((minutes < 10) ? ":0"+minutes : ":"+minutes);
    timerRunning = true;

    mydate = new Date(); 
    myday = mydate.getDay(); 
    mymonth = mydate.getMonth(); 
    myweekday= mydate.getDate(); 
    weekday= myweekday; 
    myyear= mydate.getYear(); 
    year = myyear;
    
    if(myday == 0)
        day = " Sunday,";
    else if(myday == 1)
        day = " Monday,";
    else if(myday == 2) 
        day = " Tuesday,";
    else if(myday == 3) 
        day = " Wednesday,";
    else if(myday == 4) 
        day = " Thursday,";
    else if(myday == 5) 
        day = " Friday,";
    else if(myday == 6) 
        day = " Saturday,";

    if(mymonth == 0) 
        month = " January ";
    else if(mymonth ==1) 
        month = " February ";
    else if(mymonth ==2) 
        month = " March ";
    else if(mymonth ==3) 
        month = " April ";
    else if(mymonth ==4) 
        month = " May ";
    else if(mymonth ==5) 
        month = " June ";
    else if(mymonth ==6) 
        month = " July ";
    else if(mymonth ==7) 
        month = " August ";
    else if(mymonth ==8) 
        month = " September ";
    else if(mymonth ==9) 
        month = " October ";
    else if(mymonth ==10) 
        month = " November ";
    else if(mymonth ==11) 
        month = " December ";

    $("#apuracao").val("Result calculated" + day + month + myweekday + ", " +(year+1900) + " - " + timeValue);
$("a[id='fb']").attr("href", "http://www.facebook.com/sharer.php?s=100&p[title]=Cálculo da evolução da perda de peso&p[summary]="+
"Peso Inicial: "+peso_Inicial+
" Peso Atual: "+peso_Atual+
" Altura: "+varAltura+
" Excesso Inicial: "+excesso_Inicial+
" IMC Inicial: "+$("#imcInicial").val()+
" Excesso Atual: "+excesso_Atual+
" IMC Atual: "+$("#imcAtual").val()+
" Excesso Eliminado: "+$("#perda").val()+
" "+$("#apuracao").val()+
" Cronograma de evolulção prevista: "+
"1º mês (15-20%): "+
"2º mês (25-30%): "+
"3º mês (30-40%): "+
"6º mês (45-55%): "+
"9º mês (55-65%): "+
"12º ao 18º mês (65-85%): "+
"&p[url]=http://bit.ly/bariatrica&p[images][0]=https://dl.dropboxusercontent.com/u/20105045/img/a.jpg");
}

